-- Y 1:  1/ loc nhung team ma memberid lam PO
CREATE OR REPLACE FUNCTION myagile.getMembersofPO(PO_ID BIGINT) RETURNS SETOF myagile.member AS $body$ SELECT m.* FROM myagile.member m, myagile.team_member tm WHERE m.id = tm.member_id AND tm.team_id IN (SELECT tp.team_id FROM myagile.team_project tp WHERE tp.project_id IN (SELECT p.id FROM myagile.project p WHERE p.owner_id = $1)) ORDER BY tm.team_id; $body$ LANGUAGE SQL;
--========================================================
-- Y 2: 2/ loc nhung member cung dev team voi memberid nhap vao

CREATE OR REPLACE FUNCTION myagile.getSameTeamMembers(memberid BIGINT) RETURNS SETOF myagile.member AS $body$ SELECT DISTINCT m.* FROM myagile.team_member tm, myagile.member m WHERE m.id = tm.member_id AND tm.team_id IN (SELECT tm.team_id FROM myagile.team_member tm WHERE tm.member_id = $1) ORDER BY m.id; $body$ LANGUAGE SQL;

--========================================================
-- Y 3: 3/ loc nhung PO cua cac team o truong hop 2
-- cac team ma curren member truoc thuoc

CREATE OR REPLACE FUNCTION myagile.getPOsofMember(memberid BIGINT) RETURNS SETOF myagile.member AS $body$ SELECT DISTINCT m.* FROM myagile.member m WHERE m.id IN (SELECT owner_id FROM myagile.project p, myagile.team_project tp WHERE p.id = tp.project_id AND tp.team_id IN (SELECT tm.team_id FROM myagile.team_member tm WHERE tm.member_id = $1)) ORDER BY m.id; $body$ LANGUAGE SQL;

--========================================================
--// gop chung 1 danh sach Scrum Team

CREATE OR REPLACE FUNCTION myagile.getScrumTeamMember(memberid BIGINT)  RETURNS SETOF myagile.member AS $body$ SELECT DISTINCT m.* FROM (SELECT * FROM myagile.getMembersofPO($1) UNION SELECT * FROM myagile.getSameTeamMembers($1) UNION SELECT * FROM myagile.getPOsofMember($1)) AS m WHERE m.id != $1 ORDER BY m.id; $body$LANGUAGE SQL;
